import React from 'react';
import { Blockquote } from 'loft-ui';

function App() {
  return (
    <div className="App">
      <Blockquote>
        Mussum Ipsum, cacilds vidis litro abertis. A ordem dos tratores não
        altera o pão duris. Paisis, filhis, espiritis santis. Cevadis im ampola
        pa arma uma pindureta. Leite de capivaris, leite de mula manquis sem
        cabeça.
      </Blockquote>
    </div>
  );
}

export default App;
